import React, { Component } from 'react';
import Router from "../../components/layouts/Router";
import './registerLogin.scss';

class Register extends Component {
    render() {
        return (
            <Router>
                <div className='Register authPage'>
                    
                    register page
                </div>
            </Router>
        );
    }
}

export default Register;
